'use client';

import { useState } from 'react';
import { Menu, X } from 'lucide-react';
import { Button } from '@/components/buttons';
import Link from 'next/link';
import { usePathname } from 'next/navigation';
import { useRouter } from 'next/navigation';

export const Navbar = () => {
    const [isOpen, setIsOpen] = useState(false);
    const pathname = usePathname();
    const router = useRouter();

    const navLinks = [
        { label: 'Home', href: '/' },
        { label: 'About Us', href: '/about-us' },
        { label: 'Portfolio', href: '/portfolio' },
        { label: 'Services', href: '/services' },
        { label: 'Contact Us', href: '/contact-us' },
        { label: 'Blog and News', href: '/blog' },
        { label: 'Life at Achtrex', href: '/life-at-achtrex' }
    ];

    return (
        <nav className="fixed top-0 left-0 right-0 bg-white backdrop-blur-sm z-50">
            <div className="max-w-7xl flex justify-between items-center mx-auto px-6 lg:px-8">
                <div className="flex justify-between items-center h-20">
                    <Link href="/" className="flex items-center space-x-2">
                        <svg width="48" height="48" viewBox="0 0 48 48" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
                            <rect width="48" height="48" fill="url(#pattern0_453_1567)" />
                            <defs>
                                <pattern id="pattern0_453_1567" patternContentUnits="objectBoundingBox" width="1" height="1">
                                    <use xlinkHref="#image0_453_1567" transform="matrix(0.002 0 0 0.0020202 0 0.010101)" />
                                </pattern>
                                <image id="image0_453_1567" width="500" height="500" preserveAspectRatio="none" xlinkHref="data:image/png;base64," />
                            </defs>
                        </svg>
                    </Link>
                </div>

                {/* Desktop Navigation */}
                <div className="hidden lg:flex items-center space-x-8">
                    {navLinks.map((link) => {
                        const isActive = pathname === link.href;
                        return (
                            <Link
                                key={link.label}
                                href={link.href}
                                className={`text-sm font-medium transition-colors ${isActive ? 'text-blue-600 underline underline-offset-4' : 'text-gray-700 hover:text-blue-600'
                                    }`}
                            >
                                {link.label}
                            </Link>
                        );
                    })}
                </div>


                <div className="hidden lg:block">
                    <Link href="/contact-us">
                        <Button size="sm" onClick={() => router.push('/contact-us')} >Request Quote</Button>
                    </Link>
                </div>


                {/* Mobile Menu Button */}
                <button
                    onClick={() => setIsOpen(!isOpen)}
                    className="lg:hidden p-2 rounded-lg hover:bg-gray-100"
                >
                    {isOpen ? <X size={24} /> : <Menu size={24} />}
                </button>
            </div>

            {/* Mobile Menu */}
            {
                isOpen && (
                    <div className="lg:hidden bg-white border-t">
                        <div className="px-6 py-4 space-y-3">
                            {navLinks.map((link) => {
                                const isActive = pathname === link.href;
                                return (
                                    <Link
                                        key={link.label}
                                        href={link.href}
                                        className={`block py-2 text-base font-medium ${isActive ? 'text-blue-600 bg-gray-50' : 'text-gray-700 hover:text-blue-600 hover:bg-gray-50'
                                            }`}
                                        onClick={() => setIsOpen(false)}
                                    >
                                        {link.label}
                                    </Link>
                                );
                            })}
                            <Button size="sm" className="w-full mt-4">Request Quote</Button>
                        </div>
                    </div>
                )
            }
        </nav >
    );
};